import React, {Component} from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Home from './Home';
import Visual from './Visual';
import About from './About';
import UI from './UI';
import './App.css';

function App() {
  return(
    <Router>
      <Switch>
        <Route path="home">
          <Home />
        </Route>
        <Route path="ui">
          <UI />
        </Route>
        <Route path="visual">
          <Visual />
        </Route>
        <Route path="about">
          <About />
        </Route>
      </Switch>
    </Router>
  )
}

export default App;
